import React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';

export default function PresentationLayer() {
  return (
    <Box sx={{ padding: '20px' }}>
      <Box sx={{ display: 'flex', padding: '10px' }}>
        <TextField
          select
          label="Search for shop"
          fullWidth
          sx={{ marginRight: '10px' }}
        >
          {/* Options for the shop selection */}
          <MenuItem value="Shop A">Shop A</MenuItem>
          <MenuItem value="Shop B">Shop B</MenuItem>
        </TextField>
        <TextField
          select
          label="Select for inventory"
          fullWidth
        >
          {/* Options for the inventory selection */}
          <MenuItem value="Grocery">Grocery</MenuItem>
          <MenuItem value="Electronics">Electronics</MenuItem>
        </TextField>
      </Box>
    </Box>
  );
}
